import { configureStore } from '@reduxjs/toolkit';
import userSlicer from './features/userSlice.js';
import shoppingSlicer from './features/shoppingSlice.js'


export const store = configureStore({
    reducer: {
        user: userSlicer,
        shopping: shoppingSlicer
    },
    devTools: true
})
